import data from "../db.json";
import { useFormik } from "formik";

const getInitialValues = () => {
  const values = [];
  data.items.forEach((item) => {
    if (item.name) values.push(item.name);
  });
  return values;
};

function Form(props) {
  console.log(getInitialValues());
  return <div></div>;
}

export default Form;
